import {BrowserRouter,Routes,Route} from 'react-router-dom'
import Login from './'

function App() {
  return (
  //路由配置（包裹）
  <BrowserRouter>
	    <div className="App">
	    {/* 路由出口 */}
	    <Routes>
	        {/* 创建路由 path 跟组件的对应关系 */}
	            <Route path='/' element={<Layout />}></Route>
				<Route path='/login' element={<Login />}></Route>

	    </Routes>
	    </div>
    </BrowserRouter>
  );
}

export default App;
